(11, 'Hệ thống Y tế Thu Cúc TCI', 'Cơ sở Đại Từ: 32 Đại Từ, Hoàng Mai, Hà Nội', , '<h2>GIỚI THIỆU</h2>\n<p>Hệ thống Y tế Thu Cúc TCI tự hào là đơn vị y tế được hàng triệu người dân tin tưởng và Sở Y tế công nhận</p>\n<ul>\n<li>\n<p>Huy chương vàng Dịch vụ y tế do Bộ Y tế trao tặng</p>\n</li>\n<li>\n<p>TOP 3 Bệnh viện tư nhân có điểm chất lượng dẫn đầu Hà Nội</p>\n</li>\n<li>\n<p>TOP 5 bệnh viện có điểm chất lượng cao nhất</p>\n</li>\n<li>\n<p>99% khách hàng đánh giá hài lòng theo thang điểm chấm của Sở Y tế</p>\n</li>\n</ul>\n<p><strong>Hệ thống Y tế Thu Cúc TCI quy tụ đội ngũ bác sĩ gồm đông đảo các Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ giỏi chuyên môn và giàu kinh nghiệm.</strong></p>\n<ul>\n<li>Đại tá, Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa II, Thầy thuốc nhân dân Nguyễn Văn Quýnh: 40 năm kinh nghiệm trong chuyên khoa Tim mạch. Hơn 30 năm công tác tại Bệnh viện Trung ương Quận đội 108</li>\n<li>Thầy thuốc ưu tú, Bác sĩ chuyên khoa II Nguyễn Thị Kim Loan: Nguyên Trưởng khoa Cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội</li>\n<li>Tiến sĩ, Bác sĩ Nguyễn Văn Doanh: Nguyên là chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị</li>\n<li>Tiến sĩ, Bác sĩ Nguyễn Thị Thu Hương: Nguyên Phó Giám đốc Bệnh viện Thận Hà Nội. Hơn 30 năm kinh nghiệm khám và chữa các bệnh thận, tiết niệu</li>\n<li>Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa I, Thầy thuốc nhân dân Nguyễn Xuân Thành: Hơn 30 năm kinh nghiệm trong lĩnh vực gan mật.</li>\n<li>Và nhiều Phó Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ uy tín khác.</li>\n</ul>\n<p><strong>Địa chỉ:</strong></p>\n<ul>\n<li>Cơ sở Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nội</li>\n<li>Cơ sở Trần Duy Hưng: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội</li>\n<li>Cơ sở Đại Từ: 32 Đại Từ, Hoàng Mai, Hà Nội</li>\n<li>Cơ sở Nguyễn Trãi: 136 Nguyễn Trãi, Thanh Xuân, Hà Nội</li>\n</ul>\n<p><strong>Thời gian làm việc chung:</strong></p>\n<p>Nhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc TCI triển khai giờ làm việc như sau:</p>\n<ul>\n<li>Cơ sở 286 Thụy Khuê: Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7</li>\n<li>Cơ sở 216 Trần Duy Hưng: Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần</li>\n<li>Cơ sở 32 Đại Từ: Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần</li>\n<li>Cơ sở 136 Nguyễn Trãi: Từ 8h00 - 17h00 từ Thứ 2 đến CN hàng tuần</li>\n</ul>\n<p><strong>Một số lưu ý</strong></p>\n<ul>\n<li>Cơ sở 216 Trần Duy Hưng, cơ sở 32 Đại Từ, cơ sở 136 Nguyễn Trãi chỉ nhận khám và điều trị ngoại trú. Bệnh nhân cần cấp cứu hoặc có nhu cầu điều trị nội trú cần đến cơ sở 286 Thụy Khuê.</li>\n<li>Hệ thống Y tế Thu Cúc TCI có tiếp nhận thanh toán viện phí qua thẻ ngân hàng, ví điện tử Momo.</li>\n<li>Hệ thống Y tế Thu Cúc TCI có chế độ ưu tiên rõ ràng cụ thể cho các người bệnh, đảm bảo tạo thuận lợi nhất cho việc khám chữa bệnh đạt được hiệu quả. Theo đó, quy định ưu tiên người bệnh khám bệnh, chữa bệnh như sau:</li>\n<li>Ưu tiên các trường hợp cấp cứu</li>\n<li>Trẻ em dưới 6 tuổi, người khuyết tật nặng, người già 80 tuổi trở lên, người có công với cách mạng, phụ nữ có thai.</li>\n<li>Người bệnh đặt hẹn (có dấu đã đặt hẹn)</li>\n<li>Người bệnh khám các dịch vụ khác</li>\n</ul>\n<h5>THẾ MẠNH CHUYÊN MÔN</h5>\n<p>Tại Hệ thống Y tế Thu Cúc TCI quy tụ đầy đủ các khoa và chuyên khoa để phục vụ tốt nhất nhu cầu khám chữa bệnh của người dân, bao gồm:</p>\n<ul>\n<li>Khoa Phụ sản</li>\n<li>Khoa Nội thần kinh</li>\n<li>Khoa Ngoại mổ</li>\n<li>Khoa Răng hàm mặt</li>\n<li>Chuyên khoa Tiêu hóa</li>\n<li>Chuyên khoa Gan mật</li>\n<li>Chuyên khoa Tim mạch</li>\n<li>Chuyên khoa Cơ xương khớp</li>\n<li>Chuyên khoa Tai mũi họng</li>\n<li>Chuyên khoa Nội tiết</li>\n<li>Chuyên khoa Nhi</li>\n<li>Cùng rất nhiều chuyên khoa khám chữa bệnh khác.</li>\n<li>Bên cạnh đó, TCI còn xây dựng và triển khai hệ thống gói khám sức khỏe và tầm soát ung thư phù hợp với nhu cầu của mỗi khách hàng, qua đó giúp phát hiện sớm nhất các bệnh lý tiềm ẩn và kịp thời điều trị, ngăn chặn biến chứng.</li>\n<li></li>\n</ul>\n<p><strong>TRANG THIẾT BỊ</strong></p>\n<p>Hệ thống Y tế Thu Cúc TCI đã đầu tư những trang bị y khoa hiện đại hàng đầu ở Việt Nam. Trong đó phải kể đến hệ thống phòng mổ vô khuẩn một chiều được đánh giá là hiện đại nhất hiện nay và rất hiếm có trên cả nước. Đây là hệ thống hiện đại có khả năng khử khuẩn và lọc khí tối tân, cấp khí tươi cho phòng mổ giúp người bệnh tránh được nhiễm khuẩn trong quá trình phẫu thuật và bình phục tốt hơn trong thời gian hậu phẫu. Mỗi phòng mổ đều được trang bị hệ thống cách âm, đèn mổ, bàn mổ và các dụng cụ hỗ trợ ca mổ tiên tiến nhất của các hãng thiết bị y tế danh tiếng.</p>\n<p>Cùng với đó, TCI luôn chú trọng đầu tư công nghệ, trang thiết bị y khoa hiện đại hàng đầu để đưa vào quá trình thăm khám, giúp phát hiện dấu hiệu bệnh lý dù nhỏ nhất một cách nhanh chóng nhất và chính xác nhất như:</p>\n<ul>\n<li>Chụp cắt lớp vi tính CT và chụp cộng hưởng từ MRI mang đến hình ảnh rõ nét, giúp chẩn đoán chính xác tình hình bệnh</li>\n<li>Công nghệ nội soi dạ dày, đại tràng NBI và MCU không gây đau, không khó chịu, giúp chẩn đoán được ung thư ngay trong quá trình nội soi và có thể thực hiện cắt polyp ngay tại chỗ</li>\n<li>Hệ thống xét nghiệm robot tự động, đạt tiêu chuẩn quốc tế ISO 15189:2012</li>\n<li>Công nghệ đốt sóng cao tần u tuyến giáp và hút u vú chân không - không mổ, không đau, không nằm viện</li>\n<li>Tán sỏi thận, sỏi tiết niệu công nghệ cao an toàn, không cần mổ và ít xâm lấn</li>\n</ul>\n', '\n## GIỚI THIỆU\n\nHệ thống Y tế Thu Cúc TCI tự hào là đơn vị y tế được hàng triệu người dân tin tưởng và Sở Y tế công nhận\n\n* Huy chương vàng Dịch vụ y tế do Bộ Y tế trao tặng\n\n* TOP 3 Bệnh viện tư nhân có điểm chất lượng dẫn đầu Hà Nội\n* TOP 5 bệnh viện có điểm chất lượng cao nhất\n* 99% khách hàng đánh giá hài lòng theo thang điểm chấm của Sở Y tế\n\n**Hệ thống Y tế Thu Cúc TCI quy tụ đội ngũ bác sĩ gồm đông đảo các Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ giỏi chuyên môn và giàu kinh nghiệm.**\n\n* Đại tá, Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa II, Thầy thuốc nhân dân Nguyễn Văn Quýnh: 40 năm kinh nghiệm trong chuyên khoa Tim mạch. Hơn 30 năm công tác tại Bệnh viện Trung ương Quận đội 108\n* Thầy thuốc ưu tú, Bác sĩ chuyên khoa II Nguyễn Thị Kim Loan: Nguyên Trưởng khoa Cơ xương khớp và Nội tổng hợp Bệnh viện E Hà Nội\n* Tiến sĩ, Bác sĩ Nguyễn Văn Doanh: Nguyên là chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị\n* Tiến sĩ, Bác sĩ Nguyễn Thị Thu Hương: Nguyên Phó Giám đốc Bệnh viện Thận Hà Nội. Hơn 30 năm kinh nghiệm khám và chữa các bệnh thận, tiết niệu\n* Phó Giáo sư, Tiến sĩ, Bác sĩ chuyên khoa I, Thầy thuốc nhân dân Nguyễn Xuân Thành: Hơn 30 năm kinh nghiệm trong lĩnh vực gan mật.\n* Và nhiều Phó Giáo sư, Tiến sĩ, Thạc sĩ, Bác sĩ uy tín khác.\n\n**Địa chỉ:**\n\n* Cơ sở Thụy Khuê: 286 Thụy Khuê, Tây Hồ, Hà Nội\n* Cơ sở Trần Duy Hưng: 216 Trần Duy Hưng, Cầu Giấy, Hà Nội\n* Cơ sở Đại Từ: 32 Đại Từ, Hoàng Mai, Hà Nội\n* Cơ sở Nguyễn Trãi: 136 Nguyễn Trãi, Thanh Xuân, Hà Nội\n\n**Thời gian làm việc chung:**\n\nNhằm đáp ứng tối đa nhu cầu thăm khám, điều trị và chăm sóc sức khỏe của đông đảo người bệnh, Hệ thống y tế Thu Cúc TCI triển khai giờ làm việc như sau:\n\n* Cơ sở 286 Thụy Khuê: Từ 6h30 – 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần; Cấp cứu 24/7\n* Cơ sở 216 Trần Duy Hưng: Từ 7h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần\n* Cơ sở 32 Đại Từ: Từ 8h00 - 17h00 từ Thứ 2 đến Chủ Nhật hàng tuần\n* Cơ sở 136 Nguyễn Trãi: Từ 8h00 - 17h00 từ Thứ 2 đến CN hàng tuần\n\n**Một số lưu ý**\n\n* Cơ sở 216 Trần Duy Hưng, cơ sở 32 Đại Từ, cơ sở 136 Nguyễn Trãi chỉ nhận khám và điều trị ngoại trú. Bệnh nhân cần cấp cứu hoặc có nhu cầu điều trị nội trú cần đến cơ sở 286 Thụy Khuê.\n* Hệ thống Y tế Thu Cúc TCI có tiếp nhận thanh toán viện phí qua thẻ ngân hàng, ví điện tử Momo.\n* Hệ thống Y tế Thu Cúc TCI có chế độ ưu tiên rõ ràng cụ thể cho các người bệnh, đảm bảo tạo thuận lợi nhất cho việc khám chữa bệnh đạt được hiệu quả. Theo đó, quy định ưu tiên người bệnh khám bệnh, chữa bệnh như sau:\n*  Ưu tiên các trường hợp cấp cứu\n* Trẻ em dưới 6 tuổi, người khuyết tật nặng, người già 80 tuổi trở lên, người có công với cách mạng, phụ nữ có thai.\n* Người bệnh đặt hẹn (có dấu đã đặt hẹn)\n* Người bệnh khám các dịch vụ khác\n\n##### THẾ MẠNH CHUYÊN MÔN\n\nTại Hệ thống Y tế Thu Cúc TCI quy tụ đầy đủ các khoa và chuyên khoa để phục vụ tốt nhất nhu cầu khám chữa bệnh của người dân, bao gồm:\n\n* Khoa Phụ sản\n* Khoa Nội thần kinh\n* Khoa Ngoại mổ\n* Khoa Răng hàm mặt\n* Chuyên khoa Tiêu hóa\n* Chuyên khoa Gan mật\n* Chuyên khoa Tim mạch\n* Chuyên khoa Cơ xương khớp\n* Chuyên khoa Tai mũi họng\n* Chuyên khoa Nội tiết\n* Chuyên khoa Nhi\n* Cùng rất nhiều chuyên khoa khám chữa bệnh khác.\n* Bên cạnh đó, TCI còn xây dựng và triển khai hệ thống gói khám sức khỏe và tầm soát ung thư phù hợp với nhu cầu của mỗi khách hàng, qua đó giúp phát hiện sớm nhất các bệnh lý tiềm ẩn và kịp thời điều trị, ngăn chặn biến chứng.\n*\n\n**TRANG THIẾT BỊ**\n\nHệ thống Y tế Thu Cúc TCI đã đầu tư những trang bị y khoa hiện đại hàng đầu ở Việt Nam. Trong đó phải kể đến hệ thống phòng mổ vô khuẩn một chiều được đánh giá là hiện đại nhất hiện nay và rất hiếm có trên cả nước. Đây là hệ thống hiện đại có khả năng khử khuẩn và lọc khí tối tân, cấp khí tươi cho phòng mổ giúp người bệnh tránh được nhiễm khuẩn trong quá trình phẫu thuật và bình phục tốt hơn trong thời gian hậu phẫu. Mỗi phòng mổ đều được trang bị hệ thống cách âm, đèn mổ, bàn mổ và các dụng cụ hỗ trợ ca mổ tiên tiến nhất của các hãng thiết bị y tế danh tiếng.\n\nCùng với đó, TCI luôn chú trọng đầu tư công nghệ, trang thiết bị y khoa hiện đại hàng đầu để đưa vào quá trình thăm khám, giúp phát hiện dấu hiệu bệnh lý dù nhỏ nhất một cách nhanh chóng nhất và chính xác nhất như:\n\n* Chụp cắt lớp vi tính CT và chụp cộng hưởng từ MRI mang đến hình ảnh rõ nét, giúp chẩn đoán chính xác tình hình bệnh\n* Công nghệ nội soi dạ dày, đại tràng NBI và MCU không gây đau, không khó chịu, giúp chẩn đoán được ung thư ngay trong quá trình nội soi và có thể thực hiện cắt polyp ngay tại chỗ\n* Hệ thống xét nghiệm robot tự động, đạt tiêu chuẩn quốc tế ISO 15189:2012\n* Công nghệ đốt sóng cao tần u tuyến giáp và hút u vú chân không - không mổ, không đau, không nằm viện\n* Tán sỏi thận, sỏi tiết niệu công nghệ cao an toàn, không cần mổ và ít xâm lấn', '2024-04-27 03:19:01', '2024-04-27 03:19:01');
INSERT INTO `clinic` (`id`, `name`, `address`, `image`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(12, 'Bệnh viện Y học cổ truyền Trung ương ', 'Số 29 Nguyễn Bỉnh Khiêm, Hai Bà Trưng, Hà Nội ', , '<h2>GIỚI THIỆU</h2>\n<p>Địa chỉ: 29 Nguyễn Bỉnh Khiêm, Nguyễn Du, Hai Bà Trưng, Hà Nội</p>\n<p><strong>Thời gian làm việc:</strong></p>\n<ul>\n<li>Khoa khám bệnh làm việc cả ngày từ Thứ 2 - Thứ 6</li>\n<li>Từ 7h00 - 16h00 (người bệnh nên đăng ký khám trước 15h00)</li>\n</ul>\n<p>Bệnh viện Y học Cổ truyền Trung ương là bệnh viện đầu ngành về Y học cổ truyền - Trung tâm hợp tác về y học cổ truyền của Tổ chức Y tế thế giới tại Việt Nam. Bệnh viện có 34 khoa phòng và trung tâm được chia thành 4 khối: lâm sàng, cận lâm sàng, các trung tâm và khối các phòng ban chức năng.</p>\n<p>Bệnh viện có các khoa lâm sàng Nội, Ngoại, Phụ, Nội Nhi, Châm cứu dưỡng sinh, Lão, Hồi sức cấp cứu,  Da liễu, Kiểm soát và Điều trị Ung bướu, Khám chữa bệnh tự nguyện chất lượng cao, Khoa khám bệnh, Khoa thận tiết niệu và nam học, Khoa đa khoa ngũ quan, Khoa cơ xương khớp; với đầy đủ các trang thiết bị hiện đại để phục vụ cho chẩn đoán, điều trị và nghiên cứu khoa học.</p>\n<p>Bệnh nhân được trực tiếp khám chữa bệnh là các Giáo sư, Phó giáo sư, Tiến sĩ, Thạc sĩ, BSCKI, BSCKII có chuyên môn cao, nhiều năm kinh nghiệm, là các chuyên gia đầu ngành trong lĩnh vực YHCT.</p>\n<h5>THẾ MẠNH CHUYÊN MÔN</h5>\n<p>Kết hợp y học cổ truyền với y học hiện đại trong khám và điều trị các bệnh nội khoa và ngoại khoa, bệnh viện có thế mạnh về:</p>\n<p><strong>Nội khoa</strong></p>\n<ul>\n<li>Cơ xương khớp: Viêm khớp dạng thấp, bệnh gout, viêm khớp nhiễm khuẩn, thoái hóa khớp, đau thần kinh tọa, thoát vị đĩa đệm cột sống cổ - cột sống thắt lưng, bệnh lý phần mềm quanh khớp, thấp khớp, viêm quanh khớp vai, hội chứng vai gáy, loãng xương</li>\n<li>Tim mạch: Tăng huyết áp, thiếu máu cơ tim, rối loạn thần kinh tim, huyết áp thấp, thiểu năng tuần hoàn não mạn tính, suy giãn tĩnh mạch chi...</li>\n<li>Thần kinh: Di chứng tai biến mạch máu não, liệt dây thần kinh VII ngoại biên, đau dây thần kinh liên sườn, bệnh tăng tiết mồ hôi, rối loạn tiền đình, mất ngủ, tâm căn suy nhược...</li>\n<li>Tiêu hóa - gan mật: Viêm gan, xơ gan, viêm loét dạ dày tá tràng, táo bón mạn tính, hội chứng ruột kích thích...</li>\n<li>Tiết niệu - sinh dục: Sỏi tiết niệu, Di tinh, viêm bàng quang cấp và mạn tính, rối loạn kinh nguyệt, rối loạn tiền mãn kinh...</li>\n<li>Hô hấp: Viêm xoang, viêm họng, viêm mũi dị ứng, hen phế quản, COPD...</li>\n<li>Nội tiết - dinh dưỡng - chuyển hóa: Điều trị hỗ trợ các bệnh lý rối loạn chuyển hóa như Đái tháo đường, rối loạn lipid máu, tăng acid uric...</li>\n<li>Điều trị hỗ trợ các bệnh lý như: Ung thư, suy nhược cơ thể (bệnh người già, kém ăn, mất ngủ, hay quên...)</li>\n</ul>\n<p><strong>Ngoại khoa</strong></p>\n<ul>\n<li>Bệnh lý vùng hậu môn trực tràng: Bệnh trĩ, nứt kẽ hậu môn, áp xe hậu môn, rò hậu môn, rò trực tràng âm đạo, sa trực tràng, sùi mào gà ống hậu môn...</li>\n<li>Bệnh lý tiết niệu: Sỏi tiết niệu (kết hợp tán sỏi tiết niệu ngoài cơ thể hoặc nội soi ngược dòng bằng năng lượng Laser với thuốc Y học cổ truyền), u phì đại lành tính tiền liệt tuyến...</li>\n<li>Thăm dò chức năng sinh lý ống hậu môn (Manom-etry): Cho các chỉ định: đại tiện khó, mất tự chủ hậu môn, đánh giá chức năng sinh lý ống hậu môn</li>\n<li>Test chẩn đoán chức năng nhu động đại tràng: phát hiện tình trạng rối loạn chức năng nhu động đại tràng</li>\n</ul>\n<p><strong>TRANG THIẾT BỊ</strong></p>\n<p>Bệnh viện được trang bị các các trang thiết bị y khoa hiện đại:</p>\n<ul>\n<li>MRI</li>\n<li>CT scanner</li>\n<li>X quang kỹ thuật số</li>\n<li>Máy siêu âm Doppler</li>\n<li>Máy giảm đau công nghệ mới nhất - Scrambler Therapy...</li>\n</ul>\n', '\n## GIỚI THIỆU\n\nĐịa chỉ: 29 Nguyễn Bỉnh Khiêm, Nguyễn Du, Hai Bà Trưng, Hà Nội\n\n**Thời gian làm việc:**\n\n* Khoa khám bệnh làm việc cả ngày từ Thứ 2 - Thứ 6\n* Từ 7h00 - 16h00 (người bệnh nên đăng ký khám trước 15h00)\n\nBệnh viện Y học Cổ truyền Trung ương là bệnh viện đầu ngành về Y học cổ truyền - Trung tâm hợp tác về y học cổ truyền của Tổ chức Y tế thế giới tại Việt Nam. Bệnh viện có 34 khoa phòng và trung tâm được chia thành 4 khối: lâm sàng, cận lâm sàng, các trung tâm và khối các phòng ban chức năng.\n\nBệnh viện có các khoa lâm sàng Nội, Ngoại, Phụ, Nội Nhi, Châm cứu dưỡng sinh, Lão, Hồi sức cấp cứu,  Da liễu, Kiểm soát và Điều trị Ung bướu, Khám chữa bệnh tự nguyện chất lượng cao, Khoa khám bệnh, Khoa thận tiết niệu và nam học, Khoa đa khoa ngũ quan, Khoa cơ xương khớp; với đầy đủ các trang thiết bị hiện đại để phục vụ cho chẩn đoán, điều trị và nghiên cứu khoa học.\n\nBệnh nhân được trực tiếp khám chữa bệnh là các Giáo sư, Phó giáo sư, Tiến sĩ, Thạc sĩ, BSCKI, BSCKII có chuyên môn cao, nhiều năm kinh nghiệm, là các chuyên gia đầu ngành trong lĩnh vực YHCT.\n\n\n##### THẾ MẠNH CHUYÊN MÔN\n\nKết hợp y học cổ truyền với y học hiện đại trong khám và điều trị các bệnh nội khoa và ngoại khoa, bệnh viện có thế mạnh về:\n\n**Nội khoa**\n\n* Cơ xương khớp: Viêm khớp dạng thấp, bệnh gout, viêm khớp nhiễm khuẩn, thoái hóa khớp, đau thần kinh tọa, thoát vị đĩa đệm cột sống cổ - cột sống thắt lưng, bệnh lý phần mềm quanh khớp, thấp khớp, viêm quanh khớp vai, hội chứng vai gáy, loãng xương\n* Tim mạch: Tăng huyết áp, thiếu máu cơ tim, rối loạn thần kinh tim, huyết áp thấp, thiểu năng tuần hoàn não mạn tính, suy giãn tĩnh mạch chi...\n* Thần kinh: Di chứng tai biến mạch máu não, liệt dây thần kinh VII ngoại biên, đau dây thần kinh liên sườn, bệnh tăng tiết mồ hôi, rối loạn tiền đình, mất ngủ, tâm căn suy nhược...\n* Tiêu hóa - gan mật: Viêm gan, xơ gan, viêm loét dạ dày tá tràng, táo bón mạn tính, hội chứng ruột kích thích...\n* Tiết niệu - sinh dục: Sỏi tiết niệu, Di tinh, viêm bàng quang cấp và mạn tính, rối loạn kinh nguyệt, rối loạn tiền mãn kinh...\n* Hô hấp: Viêm xoang, viêm họng, viêm mũi dị ứng, hen phế quản, COPD...\n* Nội tiết - dinh dưỡng - chuyển hóa: Điều trị hỗ trợ các bệnh lý rối loạn chuyển hóa như Đái tháo đường, rối loạn lipid máu, tăng acid uric...\n* Điều trị hỗ trợ các bệnh lý như: Ung thư, suy nhược cơ thể (bệnh người già, kém ăn, mất ngủ, hay quên...)\n\n**Ngoại khoa** \n\n* Bệnh lý vùng hậu môn trực tràng: Bệnh trĩ, nứt kẽ hậu môn, áp xe hậu môn, rò hậu môn, rò trực tràng âm đạo, sa trực tràng, sùi mào gà ống hậu môn... \n* Bệnh lý tiết niệu: Sỏi tiết niệu (kết hợp tán sỏi tiết niệu ngoài cơ thể hoặc nội soi ngược dòng bằng năng lượng Laser với thuốc Y học cổ truyền), u phì đại lành tính tiền liệt tuyến...\n* Thăm dò chức năng sinh lý ống hậu môn (Manom-etry): Cho các chỉ định: đại tiện khó, mất tự chủ hậu môn, đánh giá chức năng sinh lý ống hậu môn \n* Test chẩn đoán chức năng nhu động đại tràng: phát hiện tình trạng rối loạn chức năng nhu động đại tràng\n\n \n**TRANG THIẾT BỊ**\n\nBệnh viện được trang bị các các trang thiết bị y khoa hiện đại:\n\n* MRI\n* CT scanner\n* X quang kỹ thuật số\n* Máy siêu âm Doppler\n* Máy giảm đau công nghệ mới nhất - Scrambler Therapy...', '2024-04-27 03:22:20', '2024-04-27 03:22:20');
INSERT INTO `clinic` (`id`, `name`, `address`, `image`, `descriptionHTML`, `descriptionMarkdown`, `createdAt`, `updatedAt`) VALUES
(13, ' Bệnh viện Ung bướu Hưng Việt', '34 Đại Cồ Việt, Hai Bà Trưng, Hà Nội', , '<h2>GIỚI THIỆU</h2>\n<p><strong>Bệnh viện Ung Bướu Hưng Việt</strong> là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế.</p>\n<p>Điểm đặc biệt của bệnh viện, đội ngũ bác sĩ trực tiếp thăm khám đều là các chuyên gia đầu ngành, trưởng phó khoa của các bệnh viện lớn, chuyên sâu điều trị ung bướu: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Việt Đức,... Hơn nữa, hệ thống trang thiết bị hỗ trợ khám và điều trị ung bướu được biệt viện chú trọng đầu tư, mang lại sự thuận tiện và hiệu quả tối ưu cho quá trình điều trị ung bướu.</p>\n<p>Sự kết hợp của đội ngũ bác sĩ giỏi cùng hệ thống trang thiết bị được đầu tư, thông tin bác sĩ rõ ràng, người bệnh có thể dễ dàng đặt hẹn với bác sĩ mong muốn cùng sự hỗ trợ tận tình của đội ngũ nhân viên, Bệnh viện Hưng Việt đã trở thành địa chỉ khám và điều trị ung bướu tin cậy được nhiều người lựa chọn.</p>\n<p><strong>Địa chỉ:</strong> Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà Nội</p>\n<p><strong>Thời gian làm việc:</strong> Tất cả các ngày trong tuần (kể cả ngày lễ Tết)</p>\n<ul>\n<li>Buổi sáng: 07h00 - 12h00</li>\n<li>Buổi chiều: 13h30 - 17h00</li>\n</ul>\n<h5>THẾ MẠNH CHUYÊN MÔN</h5>\n<p>Bệnh viện hiện tập trung vào điều trị một số nhóm bệnh ung bướu cụ thể:</p>\n<ul>\n<li>Tuyến vú</li>\n<li>Tuyến giáp</li>\n<li>Tiêu hóa</li>\n<li>Đầu - mặt - cổ</li>\n</ul>\n<p>Bên cạnh đó, các bác sĩ tại bệnh viện vân thăm khám các nhóm bệnh thông thường gặp phải của các chuyên khoa:</p>\n<ul>\n<li>Tiêu hóa</li>\n<li>Tai mũi họng</li>\n<li>Nội tiết</li>\n<li>Hô hấp</li>\n</ul>\n<p><strong>TRANG THIẾT BỊ</strong></p>\n<p>Bệnh viện được trang bị đầy đủ thiết bị hỗ trợ thăm khám và điều trị ung thư hiệu quả:</p>\n<ul>\n<li>Máy gia tốc tuyến tính đa năng Elekta Synergy PlatForm: là máy xạ trị gia tốc hiện đại trong điều trị ung thư, có thể xạ trị được hầu hết các bệnh ung thư được chỉ định, tối ưu hoá rất cao liều xạ vào tổn thương đích (u, hạch) và hạn chế ảnh hưởng đến tổ chức lành, giảm thiểu tác dụng phụ. Hơn nữa, còn tiết kiệm thời gian so với phương pháp xạ trị ung thư thông thường khác. Đặc biệt loại máy này còn có thể tiến hành xạ trị các khối u ở các cơ quan di động mà các máy móc trước đây không thể thực hiện được.</li>\n<li>Máy nội soi tiêu hóa EVIS EXERA III (CV-190): Thiết bị hỗ trợ bác sĩ xác định hiệu quả các tổn thương và bất thường trong khi nội soi nhờ công nghệ xử lý chất lượng hình ảnh vượt trội, tích hợp chức năng nội soi qua dải tần hẹp (NBI), hình ảnh được chụp sắc nét ngay lần đầu tiên.</li>\n<li>Máy chụp Xquang vú (mamography): Giúp xác định các tổn thương ở mô tuyến vú.</li>\n<li>Máy chụp CT-Scanner: Hỗ trợ hữu ích trong chẩn đoán các tổn thương vùng ngực đặc biệt là ung thư phổi, tủy sống, vùng bụng,...</li>\n<li>Máy chụp MRI: Giúp hỗ trợ hiệu quả trong chẩn đoán các tổn thương hệ thần kinh, mạch não, tim mạch tuyến vú, vùng chậu,...</li>\n<li>Trung tâm hóa trị: Tùy thuộc vào loại ung bướu và tình trạng, người bệnh sẽ được các bác sĩ lên kế hoạch điều trị với hóa chất theo liều tối ưu. Trung tâm thường xuyên cập nhật kiến thức mới, phác đồ điều trị tiên tiến, hóa chất ít tác dụng phụ để ngày một nâng cao hiệu quả điều trị cho người bệnh.</li>\n<li>Bên cạnh đó, các phòng lưu trú của bệnh viện cũng được đầu tư để bệnh nhân có khu vực nghỉ ngơi thuận tiện, thoải mái trong thời gian điều trị.</li>\n</ul>\n', '\n\n## GIỚI THIỆU\n\n**Bệnh viện Ung Bướu Hưng Việt** là bệnh viện chuyên khoa Ung Bướu tư nhân đầu tiên tại Việt Nam. Bệnh viện được định hướng phát triển thành đơn vị chăm sóc sức khỏe toàn diện sánh ngang với các bệnh viện trong khu vực và quốc tế. \n\nĐiểm đặc biệt của bệnh viện, đội ngũ bác sĩ trực tiếp thăm khám đều là các chuyên gia đầu ngành, trưởng phó khoa của các bệnh viện lớn, chuyên sâu điều trị ung bướu: Bệnh viện K Trung ương, Bệnh viện Bạch Mai, Bệnh viện Việt Đức,... Hơn nữa, hệ thống trang thiết bị hỗ trợ khám và điều trị ung bướu được biệt viện chú trọng đầu tư, mang lại sự thuận tiện và hiệu quả tối ưu cho quá trình điều trị ung bướu.\n\nSự kết hợp của đội ngũ bác sĩ giỏi cùng hệ thống trang thiết bị được đầu tư, thông tin bác sĩ rõ ràng, người bệnh có thể dễ dàng đặt hẹn với bác sĩ mong muốn cùng sự hỗ trợ tận tình của đội ngũ nhân viên, Bệnh viện Hưng Việt đã trở thành địa chỉ khám và điều trị ung bướu tin cậy được nhiều người lựa chọn.\n\n**Địa chỉ:** Số 34 Đường Đại Cồ Việt, Hai Bà Trưng, Hà Nội\n\n**Thời gian làm việc:** Tất cả các ngày trong tuần (kể cả ngày lễ Tết)\n\n* Buổi sáng: 07h00 - 12h00\n* Buổi chiều: 13h30 - 17h00\n\n\n##### THẾ MẠNH CHUYÊN MÔN\n\nBệnh viện hiện tập trung vào điều trị một số nhóm bệnh ung bướu cụ thể:\n\n* Tuyến vú\n* Tuyến giáp\n* Tiêu hóa\n* Đầu - mặt - cổ\n\nBên cạnh đó, các bác sĩ tại bệnh viện vân thăm khám các nhóm bệnh thông thường gặp phải của các chuyên khoa:\n\n* Tiêu hóa\n* Tai mũi họng\n* Nội tiết\n* Hô hấp\n\n**TRANG THIẾT BỊ**\n\nBệnh viện được trang bị đầy đủ thiết bị hỗ trợ thăm khám và điều trị ung thư hiệu quả:\n\n* Máy gia tốc tuyến tính đa năng Elekta Synergy PlatForm: là máy xạ trị gia tốc hiện đại trong điều trị ung thư, có thể xạ trị được hầu hết các bệnh ung thư được chỉ định, tối ưu hoá rất cao liều xạ vào tổn thương đích (u, hạch) và hạn chế ảnh hưởng đến tổ chức lành, giảm thiểu tác dụng phụ. Hơn nữa, còn tiết kiệm thời gian so với phương pháp xạ trị ung thư thông thường khác. Đặc biệt loại máy này còn có thể tiến hành xạ trị các khối u ở các cơ quan di động mà các máy móc trước đây không thể thực hiện được.\n* Máy nội soi tiêu hóa EVIS EXERA III (CV-190): Thiết bị hỗ trợ bác sĩ xác định hiệu quả các tổn thương và bất thường trong khi nội soi nhờ công nghệ xử lý chất lượng hình ảnh vượt trội, tích hợp chức năng nội soi qua dải tần hẹp (NBI), hình ảnh được chụp sắc nét ngay lần đầu tiên. \n* Máy chụp Xquang vú (mamography): Giúp xác định các tổn thương ở mô tuyến vú.\n* Máy chụp CT-Scanner: Hỗ trợ hữu ích trong chẩn đoán các tổn thương vùng ngực đặc biệt là ung thư phổi, tủy sống, vùng bụng,...\n* Máy chụp MRI: Giúp hỗ trợ hiệu quả trong chẩn đoán các tổn thương hệ thần kinh, mạch não, tim mạch tuyến vú, vùng chậu,...\n* Trung tâm hóa trị: Tùy thuộc vào loại ung bướu và tình trạng, người bệnh sẽ được các bác sĩ lên kế hoạch điều trị với hóa chất theo liều tối ưu. Trung tâm thường xuyên cập nhật kiến thức mới, phác đồ điều trị tiên tiến, hóa chất ít tác dụng phụ để ngày một nâng cao hiệu quả điều trị cho người bệnh.\n* Bên cạnh đó, các phòng lưu trú của bệnh viện cũng được đầu tư để bệnh nhân có khu vực nghỉ ngơi thuận tiện, thoải mái trong thời gian điều trị.', '2024-04-27 03:24:36', '2024-04-27 03:24:36');

