(3, 'Giám đốc Phòng khám Chuyên khoa Nội An Phước\nBác sĩ chuyên khoa Tiêu hóa - Gan mật - Nội soi tiêu hóa\nHơn 15 năm công tác tại Bệnh viện Nhân dân 115\nBác sĩ nhận khám cho bệnh nhân từ 15 tuổi trở lên', '<p><strong>Thạc sĩ, Bác sĩ Hứa Thúy Vi</strong></p>\n<ul>\n<li>\n<p>Giám đốc Phòng khám Chuyên khoa Nội An Phước</p>\n</li>\n<li>\n<p>Bác sĩ chuyên khoa Tiêu hóa - Gan mật - Nội soi tiêu hóa</p>\n</li>\n<li>\n<p>Bác sĩ nhận khám cho bệnh nhân từ 15 tuổi trở lên</p>\n</li>\n<li>\n<p>Hơn 15 năm công tác tại Bệnh viện Nhân dân 115</p>\n</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>\n<p>Hiện là Giám đốc Phòng khám Chuyên khoa Nội An Phước (2018 - nay)</p>\n</li>\n<li>\n<p>Bác sĩ điều trị, khoa Tiêu hóa, Bệnh viện Nhân dân 115 (2004 - 2018)</p>\n</li>\n<li>\n<p>Bác sĩ nội soi tiêu hóa, khoa Nội soi, Bệnh viện Nhân dân 115 (2004 - 2018)</p>\n</li>\n<li>\n<p>Bác sĩ luân khoa, Bệnh viện Nhân dân 115 (2003 - 2004)</p>\n</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>\n<p>Tốt nghiệp Thạc sĩ chuyên ngành Nội tổng quát, Đại học Y dược TPHCM (2012)</p>\n</li>\n<li>\n<p>Tốt nghiệp Bác sĩ đa khoa, Đại học Y khoa Phạm Ngọc Thạch (2002)</p>\n</li>\n<li>\n<p>Chứng chỉ Nội soi đại tràng, Bệnh viện Chợ Rẫy (2015)</p>\n</li>\n<li>\n<p>Chứng chỉ Nội soi dạ dày - tá tràng, Bệnh viện Nhân dân 115 (2014)</p>\n</li>\n<li>\n<p>Chứng chỉ Siêu âm tổng quát thực hành, Bệnh viện Đại học Y dược TPHCM (2005)</p>\n</li>\n</ul>\n<p><strong>Thành viên các Hội khoa học, tổ chức chuyên môn</strong></p>\n<ul>\n<li>Hội Tiêu hóa - Gan mật</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<p><strong>Bác sĩ khám và điều trị:</strong></p>\n<ul>\n<li>\n<p>Viêm loét dạ dày: đau bụng, nôn ói, đầy bụng</p>\n</li>\n<li>\n<p>Viêm thực quản trào ngược: nghẹn, nuốt nghẹn, khó thở, ho kéo dài</p>\n</li>\n<li>\n<p>Nhiễm HP dạ dày: đau bụng, nôn ói, đầy bụng</p>\n</li>\n<li>\n<p>Loét thực quản: nuốt vướng</p>\n</li>\n<li>\n<p>Đầy bụng chưa rõ nguyên nhân: đầy, chướng bụng</p>\n</li>\n<li>\n<p>Đau bụng chưa rõ nguyên nhân: đau bụng</p>\n</li>\n<li>\n<p>Viêm đại tràng: rối loạn đi tiêu lúc táo bón lúc tiêu chảy</p>\n</li>\n<li>\n<p>Viêm ruột: đau bụng, tiêu lỏng, tiêu máu, sốt</p>\n</li>\n<li>\n<p>Hội chứng ruột kích thích: rối loạn đi tiêu lúc táo bón lúc tiêu chảy</p>\n</li>\n<li>\n<p>Bệnh Crohn: đau bụng, tiêu máu, sụt cân</p>\n</li>\n<li>\n<p>Rối loạn tiêu hoá: rối loạn đi tiêu</p>\n</li>\n<li>\n<p>Viêm gan siêu vi B tăng men gan, đầy bụng, vàng da, vàng mắt</p>\n</li>\n<li>\n<p>Viêm gan siêu vi C: có thể chưa có triệu chứng qua khám sức khoẻ</p>\n</li>\n<li>\n<p>Xơ gan do rượu: vàng da, vàng mắt, tiểu vàng</p>\n</li>\n<li>\n<p>Xơ gan do viêm gan siêu vi: vàng da, vàng mắt, tiểu vàng</p>\n</li>\n<li>\n<p>Viêm gan chưa rõ nguyên nhân: tăng men gan, ngứa, ăn kém</p>\n</li>\n<li>\n<p>Tăng men gan: tăng men gan, ngứa, ăn kém</p>\n</li>\n<li>\n<p>Dãn tĩnh mạch thực quản: tiêu phân đen, hoặc có tiền căn xơ gan trước đó</p>\n</li>\n<li>\n<p>Vàng da chưa rõ nguyên nhân: vàng da, vàng mắt, tiều vàng</p>\n</li>\n<li>\n<p>THA, Đái tháo đường</p>\n</li>\n</ul>\n', '**Thạc sĩ, Bác sĩ Hứa Thúy Vi**\n\n* Giám đốc Phòng khám Chuyên khoa Nội An Phước\n\n* Bác sĩ chuyên khoa Tiêu hóa - Gan mật - Nội soi tiêu hóa\n\n* Bác sĩ nhận khám cho bệnh nhân từ 15 tuổi trở lên\n\n* Hơn 15 năm công tác tại Bệnh viện Nhân dân 115\n\n**Quá trình công tác**\n\n* Hiện là Giám đốc Phòng khám Chuyên khoa Nội An Phước (2018 - nay)\n\n* Bác sĩ điều trị, khoa Tiêu hóa, Bệnh viện Nhân dân 115 (2004 - 2018)\n\n* Bác sĩ nội soi tiêu hóa, khoa Nội soi, Bệnh viện Nhân dân 115 (2004 - 2018)\n\n* Bác sĩ luân khoa, Bệnh viện Nhân dân 115 (2003 - 2004)\n\n**Quá trình đào tạo**\n\n* Tốt nghiệp Thạc sĩ chuyên ngành Nội tổng quát, Đại học Y dược TPHCM (2012)\n\n* Tốt nghiệp Bác sĩ đa khoa, Đại học Y khoa Phạm Ngọc Thạch (2002)\n\n* Chứng chỉ Nội soi đại tràng, Bệnh viện Chợ Rẫy (2015)\n\n* Chứng chỉ Nội soi dạ dày - tá tràng, Bệnh viện Nhân dân 115 (2014)\n\n* Chứng chỉ Siêu âm tổng quát thực hành, Bệnh viện Đại học Y dược TPHCM (2005)\n\n**Thành viên các Hội khoa học, tổ chức chuyên môn**\n\n* Hội Tiêu hóa - Gan mật\n\n**Khám và điều trị**\n\n**Bác sĩ khám và điều trị:**\n\n\n* Viêm loét dạ dày: đau bụng, nôn ói, đầy bụng\n\n* Viêm thực quản trào ngược: nghẹn, nuốt nghẹn, khó thở, ho kéo dài\n\n* Nhiễm HP dạ dày: đau bụng, nôn ói, đầy bụng\n\n* Loét thực quản: nuốt vướng\n\n* Đầy bụng chưa rõ nguyên nhân: đầy, chướng bụng\n\n* Đau bụng chưa rõ nguyên nhân: đau bụng\n\n* Viêm đại tràng: rối loạn đi tiêu lúc táo bón lúc tiêu chảy\n\n* Viêm ruột: đau bụng, tiêu lỏng, tiêu máu, sốt\n\n* Hội chứng ruột kích thích: rối loạn đi tiêu lúc táo bón lúc tiêu chảy\n\n* Bệnh Crohn: đau bụng, tiêu máu, sụt cân\n\n* Rối loạn tiêu hoá: rối loạn đi tiêu\n\n* Viêm gan siêu vi B tăng men gan, đầy bụng, vàng da, vàng mắt\n\n* Viêm gan siêu vi C: có thể chưa có triệu chứng qua khám sức khoẻ\n\n* Xơ gan do rượu: vàng da, vàng mắt, tiểu vàng\n\n* Xơ gan do viêm gan siêu vi: vàng da, vàng mắt, tiểu vàng\n\n* Viêm gan chưa rõ nguyên nhân: tăng men gan, ngứa, ăn kém\n\n* Tăng men gan: tăng men gan, ngứa, ăn kém\n\n* Dãn tĩnh mạch thực quản: tiêu phân đen, hoặc có tiền căn xơ gan trước đó\n\n* Vàng da chưa rõ nguyên nhân: vàng da, vàng mắt, tiều vàng\n\n* THA, Đái tháo đường', 28, NULL, NULL, '2024-04-07 12:46:54', '2024-04-07 12:46:54'),
(4, 'Hơn 15 năm kinh nghiệm khám các vấn đề sức khỏe nam giới\nHiện đang công tác tại Bệnh viện Bình Dân\nTừng tu nghiệp tại nước ngoài: Singapore, Hoa Kì', '<p><strong>Tiến sĩ, Bác sĩ Chuyên khoa II Trà Anh Duy</strong></p>\n<ul>\n<li>Hơn 15 năm kinh nghiệm khám các vấn đề sức khỏe nam giới</li>\n<li>Hiện đang công tác tại Bệnh viện Bình Dân</li>\n<li>Từng tu nghiệp tại nước ngoài: Singapore, Hoa Kì</li>\n<li>Thành viên của các Hiệp hội Niệu khoa trong nước và quốc tế</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Hẹp bao quy đầu</li>\n<li>Mãn dục nam</li>\n<li>Rối loạn cương dương</li>\n<li>Xuất tinh sớm</li>\n<li>Sùi mào gà</li>\n<li>Vô sinh - Hiếm muộn</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Bác sĩ điều trị khoa Nam học - Bệnh viện Bình Dân (2013 - Nay)</li>\n<li>Bác sĩ điều trị khoa Niệu A - Bệnh viện Bình Dân (2010 - 2013)</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Tiến sĩ Y học - Đại học Y Dược Thành phố Hồ Chí Minh (2021)</li>\n<li>Phẫu thuật Tạo hình Niệu đạo Nam giới -  Đại học California, Irvine, Hoa Kỳ (2014)</li>\n<li>Bác sĩ nội trú Tiết niệu -  Trường Tiết Niệu Châu Á và Hội Tiết niệu Châu Á (2010)</li>\n<li>Bác sĩ Đa khoa - Đại học Y Dược Thành phố Hồ Chí Minh (2001 - 2007)</li>\n</ul>\n<p><strong>Thành viên các Hội khoa học, tổ chức chuyên môn</strong></p>\n<ul>\n<li>Hội Tiết niệu - Thận học Việt Nam</li>\n<li>Hội Tiết niệu - Thận học TP. HCM</li>\n<li>Hội Y học giới tính Thế giới (ISSM)</li>\n<li>Hội Nội tiết sinh sản và vô sinh TP. HCM</li>\n<li>Hội Niệu khoa châu Á</li>\n<li>Hội Niệu khoa châu Âu</li>\n<li>Hội Niệu khoa Thế giới</li>\n</ul>\n<p><strong>Giải thưởng</strong></p>\n<ul>\n<li>Bác sĩ Niệu khoa trẻ tiêu biểu châu Á (2015)</li>\n<li>Viên chức lãnh đạo, quản lý trẻ xuất sắc Bệnh viện Bình Dân (2015)</li>\n<li>Thầy thuốc trẻ tiêu biểu (2013)</li>\n</ul>\n', '\n**Tiến sĩ, Bác sĩ Chuyên khoa II Trà Anh Duy**\n\n\n* Hơn 15 năm kinh nghiệm khám các vấn đề sức khỏe nam giới\n* Hiện đang công tác tại Bệnh viện Bình Dân\n* Từng tu nghiệp tại nước ngoài: Singapore, Hoa Kì\n* Thành viên của các Hiệp hội Niệu khoa trong nước và quốc tế\n\n**Khám và điều trị**\n* Hẹp bao quy đầu\n* Mãn dục nam\n* Rối loạn cương dương\n* Xuất tinh sớm\n* Sùi mào gà\n* Vô sinh - Hiếm muộn\n\n**Quá trình công tác**\n* Bác sĩ điều trị khoa Nam học - Bệnh viện Bình Dân (2013 - Nay)\n* Bác sĩ điều trị khoa Niệu A - Bệnh viện Bình Dân (2010 - 2013)\n\n**Quá trình đào tạo**\n* Tiến sĩ Y học - Đại học Y Dược Thành phố Hồ Chí Minh (2021)\n* Phẫu thuật Tạo hình Niệu đạo Nam giới -  Đại học California, Irvine, Hoa Kỳ (2014)\n* Bác sĩ nội trú Tiết niệu -  Trường Tiết Niệu Châu Á và Hội Tiết niệu Châu Á (2010)\n* Bác sĩ Đa khoa - Đại học Y Dược Thành phố Hồ Chí Minh (2001 - 2007)\n\n**Thành viên các Hội khoa học, tổ chức chuyên môn**\n* Hội Tiết niệu - Thận học Việt Nam\n* Hội Tiết niệu - Thận học TP. HCM\n* Hội Y học giới tính Thế giới (ISSM)\n* Hội Nội tiết sinh sản và vô sinh TP. HCM\n* Hội Niệu khoa châu Á\n* Hội Niệu khoa châu Âu\n* Hội Niệu khoa Thế giới\n\n**Giải thưởng**\n* Bác sĩ Niệu khoa trẻ tiêu biểu châu Á (2015)\n* Viên chức lãnh đạo, quản lý trẻ xuất sắc Bệnh viện Bình Dân (2015)\n* Thầy thuốc trẻ tiêu biểu (2013)', 22, NULL, NULL, '2024-04-07 14:00:19', '2024-04-25 14:45:36'),
(5, 'Nguyên Trưởng khoa Tâm Thần kinh – Bệnh viện Lão Khoa Trung ương\nGiảng viên Cao cấp trường Đại học Y khoa Hà Nội\nBác sĩ khám cho người bệnh từ 13 tuổi trở lên', '<p><strong>Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Trọng Hưng</strong></p>\n<ul>\n<li>Chuyên gia đầu ngành về Thần kinh và các bệnh Lão khoa</li>\n<li>Nguyên Trưởng khoa Tâm Thần kinh – Bệnh viện Lão Khoa Trung ương</li>\n<li>Bác sỹ Nội trú Chuyên nghành Thần kinh Đại học Lille – Cộng hòa Pháp</li>\n<li>Tu nghiệp chuyên sâu tại Bệnh viện Paris 6 - Cộng Hòa Pháp về Thần kinh học, Lão khoa, Lão học</li>\n<li>Phó Giáo sư Nguyễn Trọng Hưng đã tiến hành trao đổi kinh nghiệm và tu nghiệp tại nhiều quốc gia trên thế giới.</li>\n<li>Phó Giáo sư Hưng có gần 30 bài Báo cáo khoa học và Nghiên cứu được đăng trên các tạp chí uy tín trong và ngoài nước</li>\n<li>Bác sĩ khám cho người bệnh từ 13 tuổi trở lên</li>\n<li>Bác sĩ không nhận tư vấn cho người nhà khi không có bệnh nhân</li>\n</ul>\n<p><strong>Khám &amp; điều trị các bệnh</strong></p>\n<ul>\n<li>Đau nhức đầu</li>\n<li>Giảm trí nhớ, giảm tập trung, giảm chú ý</li>\n<li>Mất ngủ</li>\n<li>Mất ngủ kéo dài</li>\n<li>Suy nhược thần kinh</li>\n<li>Các chứng lo âu, trầm cảm, rối loạn trí nhớ</li>\n</ul>\n<p><strong>Mất ngủ và rối loạn khác do thiếu ngủ</strong></p>\n<ul>\n<li>\n<p>Rối loạn giấc ngủ: ngủ không ngon, không sâu giấc, tỉnh dậy bất chợt, …</p>\n</li>\n<li>\n<p>Mệt mỏi, buồn ngủ vào buổi sáng: ngủ gật vào ban ngày, làm việc không hiệu quả, kém tập trung, …</p>\n</li>\n<li>\n<p>Rối loạn về hô hấp trong khi ngủ</p>\n</li>\n<li>\n<p>Hội chứng ngừng thở khi ngủ</p>\n</li>\n<li>\n<p>Ngáy to: ngáy quá ồn ào, ảnh hưởng đến người xung quanh làm họ tỉnh giấc, khó chịu</p>\n</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa Thần kinh</li>\n<li>Chuyên gia đầu ngành về Thần kinh và các bệnh Lão khoa</li>\n<li>Nguyên Trưởng khoa Tâm Thần kinh – Bệnh viện Lão Khoa Trung ương</li>\n<li>Nguyên Bác sỹ Khoa Thần kinh - Bệnh viện Bạch Mai</li>\n<li>Giảng viên Cao cấp trường Đại học Y khoa Hà Nội</li>\n<li>Giám đốc Trung tâm Đào tạo – Bệnh viện Lão Khoa Trung ương</li>\n<li>Thành viên Viện Hàn Lâm Thần kinh học Hoa Kỳ</li>\n</ul>\n<p>**Quá trình đào tạo **</p>\n<ul>\n<li>Tốt nghiệp Đại học Y Hà Nội năm 1991</li>\n<li>Bác sỹ Nội trú Chuyên nghành Thần kinh Đại học Y Hà Nội.</li>\n<li>Bác sỹ Nội trú Chuyên nghành Thần kinh Đại học Lille – Cộng hòa Pháp</li>\n<li>Bảo vệ luận văn Tiến sĩ Y học chuyên ngành Thần kinh tại Đại học Y Hà Nội năm 2008</li>\n<li>Học hàm Phó Giáo sư – Bộ môn Thần kinh Đại học Y Hà Nội năm 2012</li>\n<li>Tu nghiệp chuyên sâu tại Bệnh viện Paris 6 - Cộng Hòa Pháp về Thần kinh học, Lão khoa, Lão học</li>\n<li>Thành viên hội khoa học</li>\n</ul>\n<p><strong>Thành viên của các hiệp hội Y khoa Quốc tế, như:</strong></p>\n<ul>\n<li>Viện Hàn Lâm Thần Kinh Hoa Kỳ</li>\n<li>Hội Thần Kinh Học Đông Nam Á</li>\n<li>Hội rối loạn vận động và Parkinson Quốc tế</li>\n<li>Hội phòng chống Sa sút trí tuệ Châu Á</li>\n<li>Hội Đột quỵ Quốc tế</li>\n<li>Hội Thần kinh học Việt Nam</li>\n</ul>\n', '**Phó Giáo sư, Tiến sĩ, Bác sĩ Nguyễn Trọng Hưng**\n* Chuyên gia đầu ngành về Thần kinh và các bệnh Lão khoa\n* Nguyên Trưởng khoa Tâm Thần kinh – Bệnh viện Lão Khoa Trung ương\n* Bác sỹ Nội trú Chuyên nghành Thần kinh Đại học Lille – Cộng hòa Pháp\n* Tu nghiệp chuyên sâu tại Bệnh viện Paris 6 - Cộng Hòa Pháp về Thần kinh học, Lão khoa, Lão học\n* Phó Giáo sư Nguyễn Trọng Hưng đã tiến hành trao đổi kinh nghiệm và tu nghiệp tại nhiều quốc gia trên thế giới.\n* Phó Giáo sư Hưng có gần 30 bài Báo cáo khoa học và Nghiên cứu được đăng trên các tạp chí uy tín trong và ngoài nước\n* Bác sĩ khám cho người bệnh từ 13 tuổi trở lên\n* Bác sĩ không nhận tư vấn cho người nhà khi không có bệnh nhân\n\n**Khám & điều trị các bệnh**\n* Đau nhức đầu\n* Giảm trí nhớ, giảm tập trung, giảm chú ý\n* Mất ngủ\n* Mất ngủ kéo dài\n* Suy nhược thần kinh\n* Các chứng lo âu, trầm cảm, rối loạn trí nhớ\n\n**Mất ngủ và rối loạn khác do thiếu ngủ**\n\n* Rối loạn giấc ngủ: ngủ không ngon, không sâu giấc, tỉnh dậy bất chợt, …\n* Mệt mỏi, buồn ngủ vào buổi sáng: ngủ gật vào ban ngày, làm việc không hiệu quả, kém tập trung, …\n* Rối loạn về hô hấp trong khi ngủ\n\n* Hội chứng ngừng thở khi ngủ\n* Ngáy to: ngáy quá ồn ào, ảnh hưởng đến người xung quanh làm họ tỉnh giấc, khó chịu\n\n**Quá trình công tác**\n* Phó Giáo sư, Tiến sĩ, Bác sĩ Chuyên khoa Thần kinh\n* Chuyên gia đầu ngành về Thần kinh và các bệnh Lão khoa\n* Nguyên Trưởng khoa Tâm Thần kinh – Bệnh viện Lão Khoa Trung ương\n* Nguyên Bác sỹ Khoa Thần kinh - Bệnh viện Bạch Mai\n* Giảng viên Cao cấp trường Đại học Y khoa Hà Nội\n* Giám đốc Trung tâm Đào tạo – Bệnh viện Lão Khoa Trung ương\n* Thành viên Viện Hàn Lâm Thần kinh học Hoa Kỳ\n\n**Quá trình đào tạo **\n* Tốt nghiệp Đại học Y Hà Nội năm 1991\n* Bác sỹ Nội trú Chuyên nghành Thần kinh Đại học Y Hà Nội.\n* Bác sỹ Nội trú Chuyên nghành Thần kinh Đại học Lille – Cộng hòa Pháp\n* Bảo vệ luận văn Tiến sĩ Y học chuyên ngành Thần kinh tại Đại học Y Hà Nội năm 2008\n* Học hàm Phó Giáo sư – Bộ môn Thần kinh Đại học Y Hà Nội năm 2012\n* Tu nghiệp chuyên sâu tại Bệnh viện Paris 6 - Cộng Hòa Pháp về Thần kinh học, Lão khoa, Lão học \n* Thành viên hội khoa học\n\n**Thành viên của các hiệp hội Y khoa Quốc tế, như:**\n\n* Viện Hàn Lâm Thần Kinh Hoa Kỳ\n* Hội Thần Kinh Học Đông Nam Á\n* Hội rối loạn vận động và Parkinson Quốc tế\n* Hội phòng chống Sa sút trí tuệ Châu Á\n* Hội Đột quỵ Quốc tế\n* Hội Thần kinh học Việt Nam', 24, NULL, NULL, '2024-04-25 13:20:57', '2024-04-27 03:33:44'),
