(8, 'Nguyên Trưởng khoa Ngoại chung – Bệnh viện Nội tiết Trung ương\nGần 40 năm kinh nghiệm trong lĩnh vực Nội tiết, hơn 30 năm phẫu thuật tuyến giáp\nBác sĩ nhận khám trên 3 tuổi ', '<p><strong>Thầy thuốc Ưu tú, Bác sĩ CKII Nguyễn Tiến Lãng</strong></p>\n<ul>\n<li>Nguyên Trưởng khoa Ngoại chung – Bệnh viện Nội tiết Trung ương</li>\n<li>Gần 40 năm kinh nghiệm trong lĩnh vực Nội tiết, hơn 30 năm phẫu thuật tuyến giáp</li>\n<li>Bác sĩ nhận khám trên 3 tuổi</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<p><strong>Bác sĩ có thế mạnh về phẫu thuật ung thư tuyến giáp</strong></p>\n<p><strong>Khám, tư vấn, điều trị các bệnh lý tuyến giáp:</strong></p>\n<ul>\n<li>Đái tháo đường</li>\n<li>Basedow</li>\n<li>Bướu cổ</li>\n<li>Cường cận giáp</li>\n<li>Suy giáp</li>\n<li>Cường giáp</li>\n<li>Suy tuyến yên</li>\n<li>Tăng đường huyết bệnh tiểu đường</li>\n<li>Hạ đường huyết ở bệnh tiểu đường</li>\n<li>Tiền tiểu đường</li>\n<li>Tiểu đường tuýp 1</li>\n<li>Tiểu đường tuýp 2</li>\n<li>U tuyến yên</li>\n<li>Ung thư tuyến giáp</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Nguyên Trưởng khoa Ngoại chung – Bệnh viện Nội tiết Trung ương</li>\n</ul>\n<p><strong>Quá trình đào tạo</strong></p>\n<ul>\n<li>Tốt nghiệp Thủ khoa Chuyên khoa II, Đại học Y Hà Nội (2008)</li>\n</ul>\n<p><strong>Thành viên các Hội khoa học, tổ chức chuyên môn</strong></p>\n<ul>\n<li>Hội viên Hội Phẫu thuật Ung thư Tuyến giáp</li>\n<li>Hội viên Hội Phẫu thuật Nội soi</li>\n</ul>\n<p><strong>Sách và công trình nghiên cứu khoa học</strong></p>\n<ul>\n<li>Công trình nghiên cứu cấp Nhà nước về phẫu thuật nội soi ung thư tuyến giáp</li>\n<li>Công trình nghiên cứu cấp Bộ về phẫu thuật tuyến giáp</li>\n<li>Công trình nghiên cứu cấp Cơ sở về phẫu thuật tuyến giáp và các mặt bệnh tuyến giáp nói chung</li>\n<li>Báo cáo đánh giá kết quả phẫu thuật ung thư tuyến giáp phối hợp điều trị Iod 131</li>\n<li>Nhiều bài báo đăng trong các tạp chí chuyên ngành, các hội nghị nội tiết và rối loạn chuyển hóa toàn quốc – Tạp chí Y Dược học Việt Nam</li>\n</ul>\n', '\n **Thầy thuốc Ưu tú, Bác sĩ CKII Nguyễn Tiến Lãng**\n\n* Nguyên Trưởng khoa Ngoại chung – Bệnh viện Nội tiết Trung ương\n* Gần 40 năm kinh nghiệm trong lĩnh vực Nội tiết, hơn 30 năm phẫu thuật tuyến giáp\n* Bác sĩ nhận khám trên 3 tuổi\n\n**Khám và điều trị**\n\n**Bác sĩ có thế mạnh về phẫu thuật ung thư tuyến giáp**\n\n**Khám, tư vấn, điều trị các bệnh lý tuyến giáp:** \n\n* Đái tháo đường\n* Basedow\n* Bướu cổ\n* Cường cận giáp\n* Suy giáp\n* Cường giáp\n* Suy tuyến yên\n* Tăng đường huyết bệnh tiểu đường\n* Hạ đường huyết ở bệnh tiểu đường\n* Tiền tiểu đường\n* Tiểu đường tuýp 1\n* Tiểu đường tuýp 2\n* U tuyến yên\n* Ung thư tuyến giáp\n\n**Quá trình công tác**\n* Nguyên Trưởng khoa Ngoại chung – Bệnh viện Nội tiết Trung ương\n\n**Quá trình đào tạo**\n* Tốt nghiệp Thủ khoa Chuyên khoa II, Đại học Y Hà Nội (2008)\n\n**Thành viên các Hội khoa học, tổ chức chuyên môn**\n* Hội viên Hội Phẫu thuật Ung thư Tuyến giáp\n* Hội viên Hội Phẫu thuật Nội soi\n\n**Sách và công trình nghiên cứu khoa học**\n* Công trình nghiên cứu cấp Nhà nước về phẫu thuật nội soi ung thư tuyến giáp\n* Công trình nghiên cứu cấp Bộ về phẫu thuật tuyến giáp\n* Công trình nghiên cứu cấp Cơ sở về phẫu thuật tuyến giáp và các mặt bệnh tuyến giáp nói chung\n* Báo cáo đánh giá kết quả phẫu thuật ung thư tuyến giáp phối hợp điều trị Iod 131\n* Nhiều bài báo đăng trong các tạp chí chuyên ngành, các hội nghị nội tiết và rối loạn chuyển hóa toàn quốc – Tạp chí Y Dược học Việt Nam', 23, NULL, NULL, '2024-04-27 03:29:30', '2024-04-27 03:29:30'),
(9, 'Nhiều năm kinh nghiệm trong khám và điều trị các bệnh lý Nội - Ngoại Thần kinh\nHiện đang công tác tại Bệnh viện Chợ Rẫy và Bệnh viện Nhân dân 115\nBác sĩ nhận khám từ 10 tuổi ', '<p><strong>Bác sĩ Chuyên khoa II Nguyễn Tường Vũ</strong></p>\n<ul>\n<li>Nhiều năm kinh nghiệm trong khám và điều trị các bệnh lý Nội - Ngoại Thần kinh</li>\n<li>Hiện đang công tác tại Bệnh viện Chợ Rẫy và Bệnh viện Nhân dân 115</li>\n<li>Bác sĩ nhận khám từ 10 tuổi</li>\n</ul>\n<p><strong>Khám và điều trị</strong>\n<strong>Khám và điều trị các rối loạn:</strong></p>\n<ul>\n<li>Đau nửa đầu</li>\n<li>Rối loạn tiền đình</li>\n<li>Parkinson</li>\n<li>Tai biến mạch máu não</li>\n<li>Đau dây thần kinh số V</li>\n<li>Viêm đa dây thần kinh</li>\n<li>Nhược cơ</li>\n<li>Liệt mặt</li>\n<li>Đau dây thần kinh liên sườn</li>\n<li>Hội chứng liệt nửa người</li>\n<li>Hội chứng mất trí nhớ thường xuyên</li>\n</ul>\n<p><strong>Phẫu thuật bệnh lý ngoại biên:</strong></p>\n<ul>\n<li>Máu tụ DMC (dưới màng cứng) mạn tính và các CTSN</li>\n<li>Ghép sọ tự thân, nhân tạo</li>\n<li>U da đầu lành tính</li>\n<li>U màng não bán cầu</li>\n<li>Hội chứng ống cổ tay</li>\n<li>TVĐD thắt lưng</li>\n</ul>\n<p><strong>Xạ phẫu Gamma Knife:</strong></p>\n<ul>\n<li>Dị dạng mạch máu não: AVM, Cavernoma, dò DM màng cứng xoang hang</li>\n<li>Các u não lành tính còn nhỏ &lt; 3 cm hoặc còn lại sau mổ</li>\n<li>Đau thần kinh số V tái phát, thất bại sau điều trị với các phương pháp khác hay ở bệnh nhân là người già và có nhiều bệnh nội khoa khác đi kèm</li>\n</ul>\n<p><strong>Điều trị các bệnh lý về Nội Thần kinh thông thường:</strong></p>\n<ul>\n<li>Mất ngủ</li>\n<li>Đau đầu</li>\n<li>Đau lưng</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Chuyên tư vấn và trực tiếp điều trị xạ phẫu Gamma Knife về các bệnh lý trong não (Các loại u não, dị dạng mạch máu não), đau dây thần kinh số V tại Bệnh viện Chợ Rẫy và Bệnh viện 115</li>\n</ul>\n', '**Bác sĩ Chuyên khoa II Nguyễn Tường Vũ**\n* Nhiều năm kinh nghiệm trong khám và điều trị các bệnh lý Nội - Ngoại Thần kinh\n* Hiện đang công tác tại Bệnh viện Chợ Rẫy và Bệnh viện Nhân dân 115\n* Bác sĩ nhận khám từ 10 tuổi\n\n**Khám và điều trị**\n**Khám và điều trị các rối loạn:**\n\n* Đau nửa đầu\n* Rối loạn tiền đình\n* Parkinson\n* Tai biến mạch máu não\n* Đau dây thần kinh số V\n* Viêm đa dây thần kinh\n* Nhược cơ\n* Liệt mặt\n* Đau dây thần kinh liên sườn\n* Hội chứng liệt nửa người\n* Hội chứng mất trí nhớ thường xuyên\n\n**Phẫu thuật bệnh lý ngoại biên:**\n\n* Máu tụ DMC (dưới màng cứng) mạn tính và các CTSN\n* Ghép sọ tự thân, nhân tạo\n* U da đầu lành tính\n* U màng não bán cầu\n* Hội chứng ống cổ tay\n* TVĐD thắt lưng\n\n**Xạ phẫu Gamma Knife:**\n\n* Dị dạng mạch máu não: AVM, Cavernoma, dò DM màng cứng xoang hang\n* Các u não lành tính còn nhỏ < 3 cm hoặc còn lại sau mổ\n* Đau thần kinh số V tái phát, thất bại sau điều trị với các phương pháp khác hay ở bệnh nhân là người già và có nhiều bệnh nội khoa khác đi kèm\n\n**Điều trị các bệnh lý về Nội Thần kinh thông thường:**\n\n* Mất ngủ\n* Đau đầu\n* Đau lưng\n\n**Quá trình công tác**\n* Chuyên tư vấn và trực tiếp điều trị xạ phẫu Gamma Knife về các bệnh lý trong não (Các loại u não, dị dạng mạch máu não), đau dây thần kinh số V tại Bệnh viện Chợ Rẫy và Bệnh viện 115', 25, NULL, NULL, '2024-04-27 03:37:18', '2024-04-27 03:37:18'),
(10, 'Bác sĩ chuyên khoa Sản phụ khoa, Phòng khám DHA Healthcare\n20 năm kinh nghiệm trong khám và điều trị bệnh lý Sản phụ khoa', '<p><strong>Bác sĩ Phạm Thị Phương Ánh</strong></p>\n<ul>\n<li>Bác sĩ chuyên khoa Sản phụ khoa, Phòng khám DHA Healthcare</li>\n<li>20 năm kinh nghiệm trong khám và điều trị bệnh lý Sản phụ khoa</li>\n<li>Bác sĩ nhận khám mọi độ tuổi là nữ</li>\n</ul>\n<p><strong>Quá trình công tác</strong></p>\n<ul>\n<li>Hiện là Bác sĩ chuyên khoa Sản phụ khoa, Phòng khám DHA Healthcare</li>\n<li>Đảm nhiện vị trí Bác sĩ Sản phụ khoa tại nhiều Phòng khám lớn như Phòng khám Đa khoa Thiên Phước, Phòng khám Đa khoa Vì Dân,...</li>\n</ul>\n<p>8 năm kinh nghiệm làm việc tại Bệnh viện Đa khoa Vạn Xuân\n<strong>Khám và điều trị</strong></p>\n<ul>\n<li>Khám và điều trị các bệnh lý phụ khoa</li>\n<li>Rong kinh - rong huyết</li>\n<li>Các rối loạn tiền mãn kinh và mãn kinh</li>\n<li>Viêm nhiễm phụ khoa</li>\n<li>Tư vấn, chăm sóc sức khỏe sinh sản vị thành niên</li>\n<li>Khám và tư vấn sức khỏe tiền hôn nhân</li>\n<li>Ung thư phụ khoa</li>\n<li>U nang buồng trứngViêm cổ tử cung</li>\n<li>U xơ tử cung</li>\n<li>Viêm lộ tuyến cổ tử cung</li>\n</ul>\n', '**Bác sĩ Phạm Thị Phương Ánh**\n* Bác sĩ chuyên khoa Sản phụ khoa, Phòng khám DHA Healthcare\n* 20 năm kinh nghiệm trong khám và điều trị bệnh lý Sản phụ khoa\n* Bác sĩ nhận khám mọi độ tuổi là nữ\n\n**Quá trình công tác**\n* Hiện là Bác sĩ chuyên khoa Sản phụ khoa, Phòng khám DHA Healthcare\n* Đảm nhiện vị trí Bác sĩ Sản phụ khoa tại nhiều Phòng khám lớn như Phòng khám Đa khoa Thiên Phước, Phòng khám Đa khoa Vì Dân,...\n\n8 năm kinh nghiệm làm việc tại Bệnh viện Đa khoa Vạn Xuân\n**Khám và điều trị**\n* Khám và điều trị các bệnh lý phụ khoa\n* Rong kinh - rong huyết\n* Các rối loạn tiền mãn kinh và mãn kinh\n* Viêm nhiễm phụ khoa\n* Tư vấn, chăm sóc sức khỏe sinh sản vị thành niên\n* Khám và tư vấn sức khỏe tiền hôn nhân\n* Ung thư phụ khoa\n* U nang buồng trứngViêm cổ tử cung\n* U xơ tử cung\n* Viêm lộ tuyến cổ tử cung', 26, NULL, NULL, '2024-04-27 03:44:59', '2024-04-27 03:44:59'),
(11, 'Trưởng khoa Khám bệnh, Bệnh viện Đa khoa Quốc tế Thu Cúc\nNguyên chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị Việt Xô\nBác sĩ có 40 năm kinh nghiệm làm việc chuyên khoa Nội Thần kinh\nBác sĩ khám cho người bệnh từ 16 tuổi trở lên ', '<p><strong>Tiến sĩ, Bác sĩ Nguyễn Văn Doanh</strong></p>\n<ul>\n<li>Trưởng khoa Khám bệnh, Bệnh viện Đa khoa Quốc tế Thu Cúc</li>\n<li>Nguyên chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị Việt Xô</li>\n<li>Bác sĩ có 40 năm kinh nghiệm làm việc chuyên khoa Nội Thần kinh</li>\n<li>Bác sĩ khám cho người bệnh từ 16 tuổi trở lên</li>\n</ul>\n<p><strong>Khám và điều trị</strong></p>\n<ul>\n<li>Các bệnh đau đầu: Chứng đau nửa đầu, đau đầu căn nguyên mạch máu, đau đầu mạn tính hàng ngày,..</li>\n<li>Bệnh đau vai gáy do thoái hóa cột sống cổ, thoát vị đĩa đệm cột sống cổ, …</li>\n<li>Đau thắt lưng hông do thoái hóa, thoát vị, đau do viêm khớp cùng chậu…</li>\n<li>Rối loạn tiền đình</li>\n<li>Điều trị chóng mặt do thiếu máu não</li>\n<li>Tư vấn và điều trị các bệnh lý rối loạn về giấc ngủ: mất ngủ cấp tính hoặc mạn tính</li>\n<li>Liệt dây 7 ngoại vi: Viêm các dây thần kinh sọ não và các dây thần kinh ngoại vi khác như hội chứng ống cổ tay, đau vai khuỷu tay do chơi thể thao</li>\n<li>Liệt nửa người do nhồi máu não</li>\n<li>Các bệnh lý về sa sút trí tuệ: Suy giảm nhận thức nhẹ, suy giảm trí nhớ, sa sút trí tuệ nguyên nhân mạch máu (sa sút trí tuệ sau đột quỵ), Alzheimer</li>\n<li>Bệnh rối loạn vận động như bệnh Parkinson</li>\n</ul>\n', '**Tiến sĩ, Bác sĩ Nguyễn Văn Doanh**\n* Trưởng khoa Khám bệnh, Bệnh viện Đa khoa Quốc tế Thu Cúc\n* Nguyên chủ nhiệm khoa thần kinh, Bệnh viện Hữu Nghị Việt Xô\n* Bác sĩ có 40 năm kinh nghiệm làm việc chuyên khoa Nội Thần kinh\n* Bác sĩ khám cho người bệnh từ 16 tuổi trở lên\n\n**Khám và điều trị**\n* Các bệnh đau đầu: Chứng đau nửa đầu, đau đầu căn nguyên mạch máu, đau đầu mạn tính hàng ngày,..\n* Bệnh đau vai gáy do thoái hóa cột sống cổ, thoát vị đĩa đệm cột sống cổ, …\n* Đau thắt lưng hông do thoái hóa, thoát vị, đau do viêm khớp cùng chậu…\n* Rối loạn tiền đình\n* Điều trị chóng mặt do thiếu máu não\n* Tư vấn và điều trị các bệnh lý rối loạn về giấc ngủ: mất ngủ cấp tính hoặc mạn tính\n* Liệt dây 7 ngoại vi: Viêm các dây thần kinh sọ não và các dây thần kinh ngoại vi khác như hội chứng ống cổ tay, đau vai khuỷu tay do chơi thể thao\n* Liệt nửa người do nhồi máu não\n* Các bệnh lý về sa sút trí tuệ: Suy giảm nhận thức nhẹ, suy giảm trí nhớ, sa sút trí tuệ nguyên nhân mạch máu (sa sút trí tuệ sau đột quỵ), Alzheimer\n* Bệnh rối loạn vận động như bệnh Parkinson', 27, NULL, NULL, '2024-04-27 03:46:41', '2024-04-27 03:46:41');

